# Function
#   create_frgStore_files
#
# Purpose
#   Create the fragStore files to feed to consensus. These
#   frag store files were used to generate the baseline results.
#   Therefore, later runs against these files should generate 
#   the same output.
#
# Arguments
#   NONE
#
# Return
#   success - NONE
#   failure - exit 1
#
#####
